import React from 'react'
import styles from './ListStyle.module.css'


const ListStyle = (props) => {
  return (
    <div className={styles.Container} styles={{background : `${props.containerColor}`}}>
        <div className={styles.Badge} styles={{background : `${props.badgeColor}`}}>{props.number}</div>
    </div>
  )
}

export default ListStyle
